import React, { Component } from 'react';
import Particles from 'react-particles-js';
import './App.css';
import { Test } from './components/test/';
import Homepage from "./components/Homepage/";
import {TweenMax, Power2, TimelineMax, Back} from "gsap/TweenMax";

import { Route, BrowserRouter, Redirect, Switch } from "react-router-dom";
import Snap from 'snapsvg-cjs';
import * as d3 from "d3";

class App extends Component {
  render() {

    var s = Snap("#snappy");
    Snap.load("https://kenoleon.github.io/Front-End-Web-Dev-UI-UX/assets/images/simplePoly.svg",
              onSVGLoaded);

    function onSVGLoaded(data) {
          geom = data.select("#mrCube");
          s.append( data );
          geom.attr({ stroke: "cornflowerblue",
                    fill: "khaki"});
      }

    return (
      <div className="App">
        <div className="App-Wrap">
          <div ref={d=>this.svgDiv=d} />
          <BrowserRouter>
            <Switch>
              <Route
                path="/"
                exact
                component={Homepage}
              />
            </Switch>
          </BrowserRouter>
        </div>
      </div>
    );
  }
}

export default App;
